// src/App.js
import React from 'react';
// Import BrowserRouter, Routes, and Route.
// Note: It's generally better to wrap BrowserRouter in index.js, but
// for now, we'll fix the core issue here.
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';

// Import your components
import Header from './components/header';
import Navbar from './components/navbar';
import Footer from './components/footer';

// Import your page components (these will be rendered by Routes)
import Home from './components/home'; // Assuming home.js is a "page" like component
import Login from './pages/login';
import Companies from './pages/companies';
import Register from './pages/register';

function App() {
  return (
    <BrowserRouter>
      {/* Components that should appear on ALL pages */}
      <Navbar />
      <Header />


      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/companies" element={<Companies />} />
        <Route path="/register" element={<Register />} />
      </Routes>
      {/* Components that should appear on ALL pages */}
      <Footer />
    </BrowserRouter>
  );
}

export default App;
